  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0132119 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1103 in the
  East China Sea (Tung Hai), Philippine Sea and South China Sea (Nan Hai) from 2011-02-26
  to 2011-02-28. These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT
  SPEED - NORTH/SOUTH COMPONENT (V). The instruments used to collect these data include
  ADCP and GPS. These data were collected by Bruce Appelgate of University of California
  - San Diego; Scripps Institution of Oceanography as part of Transit. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
